int minOperations(int* nums, int numsSize) {
    int count[1000001] = {0};
    for (int i = 0; i < numsSize; i++) {
        count[nums[i]]++;
    }

    int twoCount = 0, oneCount = 0, operations = 0;
    for (int i = 0; i < 1000001; i++) {
        if (count[i] > 0) {
            operations += count[i] / 3;
            int remainder = count[i] % 3;
            if (remainder == 1) {
                oneCount++;
                operations++;
            } else if (remainder == 2) {
                twoCount++;
                operations++;
            }
        }
    }

    if ((oneCount - twoCount) % 3 == 0 && oneCount >= twoCount) {
        return operations;
    } else {
        return -1;
    }
}
